import axios from 'axios';
 
export default class ScheduleService {
 
 deleteTimetable(id) {
 axios.get('http://localhost:8070/timetables/deleteTimetable/' + id)
 .then(() => {
 console.log('Timetable Deleted !!!')
 })
 .catch((error) => {
 console.log(error)
 })
 }
 }
